import Backdrop from "../pokemonPopUp/Backdrop";

function LoadingPage() {
  return (
    <div>
      <Backdrop></Backdrop>
      <div className="spinner">
        <i class="fa-solid fa-spinner"></i>
      </div>
    </div>
  );
}

export default LoadingPage;
